  constructor(props) {
    super(props);
    this.state = {
      items: [
        {
          id: 1,
          tittle: "table.web",
          desc: "lreme fdgg good proff of the name or setting",
          category: "tables",
          price: "149.00",
        },
      ],
    };
  }

  render() {
    return (
      <div className="wrapper">
        <Header />
        <Footer />
      </div>
    );
  }
}

export default App;
